import { Component, OnInit } from '@angular/core';
import {PlanificacionDirectivoService} from "../services/planificacion-directivo.service";
import pdfMake from "pdfmake/build/pdfmake";
import pdfFonts from "pdfmake/build/vfs_fonts";
import {ConfirmDialogModule} from 'primeng/confirmdialog';
import {ConfirmationService} from 'primeng/api'
import {style} from "@angular/animations";
pdfMake.vfs = pdfFonts.pdfMake.vfs;

@Component({
  selector: 'app-validacion',
  templateUrl: './validacion.component.html',
  styleUrls: ['./validacion.component.css'],
  providers: [ConfirmationService]
})
export class ValidacionComponent implements OnInit {

  loading: boolean
  listaValidar: any
  listaAccionV: any
  modalProductos: boolean
  constructor(private api: PlanificacionDirectivoService,
              private confirmationService: ConfirmationService) { }

  ngOnInit(): void {
    this.getAccionVinculada()
    this.loading=false
  }
  getAccionVinculada(){
    this.api.getAccionVinculada().subscribe(res=>{
      this.listaValidar=this.numeracion(res.content)
      console.log(this.listaAccionV)
    })
  }
  numeracion(data: any) {
    for (let i = 0; i < data.length; i++) {
      data[i].numeracion = i + 1;
    }
    return data;
  }
  abrirModalProductos(datos){
    this.modalProductos=true
    this.api.datos.emit(datos)
    this.api.cerrarModal.subscribe(data=>{
      if(data!=undefined){
        this.modalProductos=data
      }
    })
  }
  generarFicha(){
    var docDefinition = {
      header: {
        columns: [
          {
            image: 'data:image/png;base64,',
            width: 100,
            height: 60,

          },
          {
            text: 'Ficha de Desempeño Insitucional',
            alignment: 'center',
            fontSize:30,
            color: '#2596be'
          }
        ]
      },

      footer: {
        columns: [
          'Left part',
          { text: 'Right part', alignment: 'right' }
        ]
      },

      content: [{
        columns:[
          {
            text:'primera',
            margin: 15
          },
          {
            text: 'segunda',
            margin: 15
          },
          {
            text: 'tecero',
            margin: 15
          },
          {
            text: 'caurto',
            margin: 15
          }
        ]
      }]

    };
    pdfMake.createPdf(docDefinition).download();
  }
  validar(){
    this.confirmationService.confirm({
      message: '¿Esta seguro que desea validar la programación realizada?',
      accept: () => {
        //Actual logic to perform a confirmation
      }
    });
  }
}
